-- ----------------------------
-- Function structure for insert_tast_detail
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."insert_tast_detail"();
CREATE OR REPLACE FUNCTION "public"."insert_tast_detail"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
	BEGIN
	 b2b_token, id_route, cp_id,
	 cluster_name,cp_name, cp_nfc, cp_qr, cp_lat, cp_long,
	 id_header
	 )
	SELECT 
		cluster_route.b2b_token, cluster_route.id_route,check_point.cp_id,
		cluster_route.cluster_name, check_point.cp_name,check_point.cp_nfc,check_point.cp_qr,check_point.cp_lat,check_point.cp_long,
		--(SELECT currval(pg_get_serial_sequence('t_task_patrol_header','id_')) WHERE ) as id_header
		new.id_
	 FROM cluster_route RIGHT JOIN check_point
	 ON check_point.b2b_token=cluster_route.b2b_token AND check_point.cluster_route::smallint = cluster_route.id_route::smallint
	 WHERE cluster_route.b2b_token=new.b2b_token AND cluster_route.flag_active::smallint =1 AND check_point.flag_disable::smallint=1 AND cluster_route.id_route::smallint = new.id_route::smallint;
	RETURN NEW;
END
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for update_task_header
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."update_task_header"();
CREATE OR REPLACE FUNCTION "public"."update_task_header"()
  RETURNS "pg_catalog"."trigger" AS $BODY$BEGIN
  -- Routine body goes here...
		UPDATE t_task_patrol_header
		SET total_done=(
			SELECT count(id_header) as total_done FROM t_task_patrol_detail WHERE id_header::INTEGER=new.id_header::INTEGER AND flag_process=3
		)
		WHERE id_::INTEGER= new.id_header::INTEGER;
	return new;
END
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

